/*
	TFS 46572
	Friday afternoon, a request came in from lender #4777, Autotrakk, for us to update via script all of the liability limits in the insurance transactions 
	on the attached excel spreadsheet. We did some initial work on it late Friday but based on the number of updates needed (@ 9300) 
	and the complexity of the script to perform those, we're going to need development support. 

	For each owner policy on this spreadsheet, the lender needs the following history updated:
	1) The Bodily Injury Per Person Amount
	2) The Bodily Injury Per Accident Amount
	3) The Property Damage Single Limit Amount
	4) The Lnhldr on Policy Flag


*/

