    CREATE TABLE #tmpLoans
    (
      LOAN_ID BIGINT ,
	  PROP_ID BIGINT,
	  LOAN_NUMBER VARCHAR(20),
	  LOSS_PAYEE VARCHAR(1),
	  ADDITIONAL_INSURED VARCHAR(1),
	  BODILY_PER_PERSON DECIMAL,
	  BODILY_PER_ACCIDENT DECIMAL,
	  PROPERTY_DAMAGE DECIMAL,


    )

Declare @Task varchar(12) = 'TASK46572B'

	
INSERT INTO #tmpLoans
(
    LOAN_ID, PROP_ID, LOAN_NUMBER, LOSS_PAYEE, ADDITIONAL_INSURED, BODILY_PER_PERSON, BODILY_PER_ACCIDENT, PROPERTY_DAMAGE
)
select  l.ID, c.PROPERTY_ID, l.NUMBER_TX, t.LOSS_PAYEE, t.ADDITIONAL_INSURED, t.BODILY_PER_PERSON, t.BODILY_PER_ACCIDENT, t.PROPERTY_DAMAGE
from loan l
join #tmpPolicyUpdateInfo t on t.LOAN_NUMBER = l.NUMBER_TX
inner join COLLATERAL c on c.LOAN_ID = l.ID and c.PURGE_DT is NULL
where l.LENDER_ID = 2453 and l.RECORD_TYPE_CD = 'G' and l.PURGE_DT is NULL

	 
