select op.ID as OP_ID, op.EXPIRATION_DT, pc.TYPE_CD, pc.SUB_TYPE_CD, max(pc.START_DT) as MAX_START_DT
into #tmpMaxStart
from OWNER_POLICY op
  join #tmpPolicies t on op.ID = t.OP_ID
  join POLICY_COVERAGE pc on op.ID = pc.OWNER_POLICY_ID and pc.PURGE_DT is null
group by op.ID, op.expiration_dt, pc.TYPE_CD, pc.SUB_TYPE_CD

select op.ID as OP_ID, pc.ID as PC_ID,  pc.TYPE_CD, pc.SUB_TYPE_CD, pc.amount_no, pc.base_amount_no
into #tmpCurrentPC
from OWNER_POLICY op
  join #tmpMaxStart t on op.ID = t.OP_ID
  join POLICY_COVERAGE pc on op.ID = pc.OWNER_POLICY_ID and pc.PURGE_DT is null
                         and t.TYPE_CD = pc.TYPE_CD and t.SUB_TYPE_CD = pc.SUB_TYPE_CD
                                        and pc.START_DT >= t.MAX_START_DT
										and pc.type_cd = 'AUTO-LIABILITY'
group by op.ID, pc.ID, pc.TYPE_CD, pc.SUB_TYPE_CD,pc.amount_no, pc.base_amount_no

select tpc.*,
case
when tpc.sub_type_CD = 'BIPP'
	then tp.bodily_per_person
when tpc.sub_type_cd = 'BIPA'
	then tp.bodily_per_accident
when tpc.sub_type_cd = 'PDSL'
	then tp.property_damage
else tpc.Amount_no
end as PC_NEW_AMOUNT,
case
when tpc.sub_type_CD = 'BIPP'
	then 'Bodily Injury Liability'
when tpc.sub_type_cd = 'BIPA'
	then 'Bodily Injury Liability'
when tpc.sub_type_cd = 'PDSL'
	then 'Property Damage Single Limit'
else ''
end as Long_type,
case
when tpc.sub_type_CD = 'BIPP'
	then 'Per Person Limit'
when tpc.sub_type_cd = 'BIPA'
	then 'Per Occurrence Limit'
when tpc.sub_type_cd = 'PDSL'
	then NULL
else ''
end as Long_sub_type,
 tp.policy_number_tx, tp.loan_id, tp.prop_id, tp.loan_number, tp.loss_payee, tp.additional_insured, tp.bodily_per_person, tp.bodily_per_accident,tp.property_damage
into #tmpUpdates 
from #tmpcurrentPC tpc
join #tmpPolicies tp on tp.op_id = tpc.op_id
order by tp.op_id



IF OBJECT_ID(N'tempdb..#tmpIHUpdates',N'U') IS NOT NULL
	drop table #tmpIHUpdates

select --ih.special_handling_xml.value('(/SH/OwnerPolicy/LienholderStatusCode)[1]', 'nvarchar(max)'), 
t.op_id, ih.id as IH_ID, t.loan_number, pc_id, sub_type_cd, t.base_amount_no, t.PC_NEW_Amount, t.prop_id, t.Long_type, t.Long_sub_type
into #tmpIHUpdates
from #tmpupdates t
cross apply( select * from 
	interaction_history ih 
	where ih.property_id = t.prop_id and ih.type_cd = 'ownerpolicy' and ih.relate_id = t.op_id and ih.purge_dt is NULL
	and ih.SPECIAL_HANDLING_XML.value('(/SH/InsuranceDocument/@DocumentType)[1]', 'nvarchar(max)') in ( 'BIN', 'NBS', 'PCH', 'RWL', 'REI')
	and ih.CREATE_DT < '08/14/2018'
--order by update_dt desc
) ih

group by t.op_id, ih.id, t.loan_number,pc_id, sub_type_cd, t.base_amount_no, t.PC_NEW_Amount, t.prop_id, t.Long_type, t.Long_sub_type

IF OBJECT_ID(N'tempdb..#tmpPDSL',N'U') IS NOT NULL
	drop table #tmpPDSL
IF OBJECT_ID(N'tempdb..#tmpBIPP',N'U') IS NOT NULL
	drop table #tmpBIPP
IF OBJECT_ID(N'tempdb..#tmpBIPA',N'U') IS NOT NULL
	drop table #tmpBIPA


select t.* ,
n.c.value('(TypeCode)[1]','varchar(128)') as IHCoverageType,
n.c.value('(SubTypeCode)[1]','varchar(128)') as IHCoverageSubType,
n.c.value('(BaseAmount)[1]','varchar(128)') as IHBaseAmount,
n.c.value('(Amount)[1]','varchar(128)') as IHCoverageAmount,
 ih.special_handling_xml
 into #tmpPDSL --drop table #tmpPDSL
from #tmpIHUpdates t
join interaction_history ih on ih.id = t.ih_id
cross apply ih.SPECIAL_HANDLING_XML.nodes('/SH/OwnerPolicy/PolicyCoverages/PolicyCoverage') n(c)
where t.sub_type_cd = 'PDSL'
and n.c.value('(SubTypeCode)[1]','varchar(128)') = t.sub_type_cd
and n.c.value('(BaseAmount)[1]','varchar(128)') <> t.PC_NEW_AMOUNT


select t.* ,
n.c.value('(TypeCode)[1]','varchar(128)') as IHCoverageType,
n.c.value('(SubTypeCode)[1]','varchar(128)') as IHCoverageSubType,
n.c.value('(BaseAmount)[1]','varchar(128)') as IHBaseAmount,
n.c.value('(Amount)[1]','varchar(128)') as IHCoverageAmount,
 ih.special_handling_xml
 into #tmpBIPA --drop table #tmpPDSL
from #tmpIHUpdates t
join interaction_history ih on ih.id = t.ih_id
cross apply ih.SPECIAL_HANDLING_XML.nodes('/SH/OwnerPolicy/PolicyCoverages/PolicyCoverage') n(c)
where t.sub_type_cd = 'BIPA'
and n.c.value('(SubTypeCode)[1]','varchar(128)') = t.sub_type_cd
and n.c.value('(BaseAmount)[1]','varchar(128)') <> t.PC_NEW_AMOUNT


select t.* ,
n.c.value('(TypeCode)[1]','varchar(128)') as IHCoverageType,
n.c.value('(SubTypeCode)[1]','varchar(128)') as IHCoverageSubType,
n.c.value('(BaseAmount)[1]','varchar(128)') as IHBaseAmount,
n.c.value('(Amount)[1]','varchar(128)') as IHCoverageAmount,
 ih.special_handling_xml
 into #tmpBIPP --drop table #tmpPDSL
from #tmpIHUpdates t
join interaction_history ih on ih.id = t.ih_id
cross apply ih.SPECIAL_HANDLING_XML.nodes('/SH/OwnerPolicy/PolicyCoverages/PolicyCoverage') n(c)
where t.sub_type_cd = 'BIPP'
and n.c.value('(SubTypeCode)[1]','varchar(128)') = t.sub_type_cd
and n.c.value('(BaseAmount)[1]','varchar(128)') <> t.PC_NEW_AMOUNT


BEGIN /* IH Updates */

--select * from #tmpPDSL
--select * from #tmpBIPA
--select * from #tmpBIPP

--PDSL
update IH
set UPDATE_DT = GETDATE(), UPDATE_USER_TX = @task,
				LOCK_ID = (LOCK_ID % 255) + 1,
